import React from 'react';
import './css/Home.css'

import Header from './components/Header'

const api_key="AIzaSyA9us6vBoPFTwVfUjoUlgIw6BofXcP3rGk"
const max_result=50

class Home extends React.Component {
  state = {
    menuNavigationHome: true,
    menuNavigationFavorites: false,
  }
  changeHome = event => {
    this.setState({menuNavigationHome: true, menuNavigationFavorites: false})
  }
  changeFavorites = event => {
    this.setState({menuNavigationHome: false, menuNavigationFavorites: true})
  }
  
  render () {
    return (
      <div className="Home">
        <Header
          menuNavigationHome={this.state.menuNavigationHome}
          menuNavigationFavorites={this.state.menuNavigationFavorites}
          changeHome={this.changeHome}
          changeFavorites={this.changeFavorites}
          exitApp={this.exitApp}
        />
        <div className="body">
          <div className="header">
            Поиск видео
          </div>
          <SearchLine
            searchQuery={this.state.searchQuery}
            inputSearchQuery={this.inputSearchQuery}
            getListVideos={this.getListVideos}
          />
          <FilterBar
            searchQueryFilterBar={this.state.searchQueryFilterBar}
            totalResults={this.state.totalResults}
            x4={this.state.x4}
            x1={this.state.x1}
            changeIndicatorFilterX4={this.changeIndicatorFilterX4}
            changeIndicatorFilterX1={this.changeIndicatorFilterX1}
          />
          <VideoList
            videoList={this.state.videoList}
            x4={this.state.x4}
            x1={this.state.x1}
          />
        </div>
      </div>
    )
  }
}

export default Home;
